The Earnshaws are Yorkshire farmers during the early 19th Century. One day, Mr. Earnshaw returns from a trip to the city, bringing with him a ragged little boy called Heathcliff. Earnshaw&amp;#039;s son, Hindley, resents the child, but Heathcliff becomes companion and soulmate to Hindley&amp;#039;s sister, Catherine. After her parents die, Cathy and Heathcliff grow up wild and free on the Moors and despite the continued enmity between Hindley and Heathcliff they&amp;#039;re happy-- until Cathy meets Edgar Linton, the son of a wealthy neighbor. Written by Marg Baskin {&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;f19c908396b1908295df8390888599949e9fdf9290&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script data-cfhash='f9e31' type=&quot;text/javascript&quot;&gt;
